      SELECT - col0 * - col2 * 92 AS col2, col2 * col1 - col2 - - - col1 * - col1 * col2 AS col0 FROM tab1 (FORMAT parquet) cor0 WHERE NOT NULL NOT IN ( col1 );
  - name: tab1

outputs:
  - name: q56.out
    data: |
